import React from 'react';
import "../../assets/styles/MyPlace.css"

function MyPlace() {
  return (
    <div className="MyPlace">
      <div className="header">
        <h2>찜 리스트</h2>
      </div>
      <div className="category">
        <p>카테고리 - 액티비티 | 카페 | 식당 | 관광지 | 병원</p>
      </div>
      <div className="map-section">
        {[...Array(4)].map((_, index) => (
          <div className="map-container" key={index}>
            <img src="/path/to/your/map/image" alt="map" />
          </div>
        ))}
      </div>
      <div className="tour-combination">
        <h3>관광지 조합</h3>
        <div className="tour-combination-list">
          {['액티비티', '관광지', '식당', '카페'].map((category, index) => (
            <div className="tour-item" key={index}>
              <img src="/path/to/your/tour/image" alt={category} />
              <p>{category}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default MyPlace;
